body:
This PR scratches an itch I've had for a while where I need to wrap a function with scope.$apply but don't want it to execute immediately.

Something like this:
```javascript
element.bind('click', function(event) {
  return scope.$apply(function() {
    // do something
  });
});
```

gets simplified to:
```javascript
element.bind('click', scope.$bind(null, function(event) {
  // do something
}));
```

Even better, if I'm working with a class I can go from this:
```javascript
var self = this;
element.bind('click', function(event) {
  return scope.$apply(function() {
    return self.someMethod(event);
  });
});
```

to something like this:
```javascript
element.bind('click', scope.$bind(this, this.someMethod));
```

In addition to adding the new method, I've gone through the existing code and found places that would benefit from using it. I also added tests where removing the existing $apply didn't produce an error. That way I could be sure the new method is doing what it should.

Please let me know what you all think. I have everything split into separate commits to make review easier. Obviously I'd merge and add a nice commit message if accepted.

* Copy can now accurately copy cyclic structures.
* Equals can now accurately assess equality of cyclic structures.
* This should enable watching of cyclic objects.

Eg: copy and equals should work as expected in the following:
```
var obj = {name: "value"};
obj['nested'] = {self: obj};

var cpy = copy(obj);
expect(equals(obj, copy)).toBe(true);
expect(obj['nested']['self']).toBe(obj);
```

However, this is NOT graph copy.
Eg.
```
var obj = {name: "value"};
nested = {level2: "level2"};
obj['nested1'] = nested;
obj['nested2'] = nested;
var cpy = copy(obj);
expect(equals(obj, copy).toBe(true);

//This will fail. Although they were the same
//in the original object, they are distinct copies now.
expect(cpy['nested1']).toBe(cpy['nested2']);
```

The resolve callback allows the application code to modify the
resolved url before it is normailzed by urlParsingNode.href for example:

var parsed = $urlUtils.resolve("foo", function(urlUtils) {
  urlUtils.protocol =
    urlUtils.protocol === 'https:' ? 'wss:' : 'ws:';
});
parsed.href // wss://localhost/foo

The resolved url object now includes the aditional properties hostname,
port, pathname, hash and search.
